					"text": "<p><span style=\"font-size: 14pt;\"><em><strong>C: Cell.</strong></em> The gate to this cell is lashed shut with rope. The cell is used to hold animals doomed to be sacrificed in rituals to Talos. There&rsquo;s a 25 percent chance that a harmless deer is trapped inside. Otherwise, the cell is empty.</span></p>",
